import React , {useState, useEffect}from 'react'
import {Link} from 'react-router-dom'

function ShowGroup(props) {
    const [groupName, setGroupName] = useState(undefined)

    useEffect(() => {
        setGroupName( props.name )   
    })
    return (
        <div>
            <Link to={'./detail'}>
                <h1>{props.name}</h1>
            </Link>
        </div>
    )
}

export default ShowGroup
